export default () => (
  <footer>
    <div
      style={{
        fontFamily:
          "'IBM Plex Sans', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, 'Noto Sans', sans-serif, 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Symbol', 'Noto Color Emoji'",
        position: "fixed",
        left: "calc(100vw - 210px)",
        top: "90vh",
        width: "200px",
        display: "flex",
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "space-evenly",
        padding: "0 5px",
        background: "rgba(0, 0, 0, 0.1)",
        color: "black",
        mixBlendMode: "difference",
        borderRadius: "5px",
        boxShadow: "rgba(0, 0, 0, 0.05) 0px 1px 2px 0px"
      }}
    >
      <img
        src="data:image/png;base64,"
        style={{ height: "25px" }}
        height="25"
        alt="logo"
      />
      <p
        style={{
          textAlign: "center",
          filter: "drop-shadow(0.05em 0.05em rgba(255, 255, 255, 0.8))"
        }}
      >
        Project by
        <a
          href="https://georgewl.dev"
          style={{ padding: "0 5px" }}
          target="_blank"
          rel="noreferrer noopener"
        >
          GeorgeWL
        </a>
      </p>
    </div>
  </footer>
);
